import "./Death.css";
import death from "../db/Death/Deaths";

function Death(){
    const data = death
    const dataItem = data.map((list) => (
        <li className="dr">
            <br/>{list.char_id} <br/>
            {list.name}<br/>
            {list.birthday}<br/>
            {list.occupation}<br/>
            {list.img}<br/>
            {list.status}<br/>
            {list.appearance}<br/>
            {list.nickname}<br/>
            {list.portrayed}<br/>
            {list.better_call_saul_appearance}
         </li>
    ));
    return (
        <div>
          <div>
              <h2>List of Death Record</h2>
          </div>
            <p>{dataItem}</p>
        </div>
    );
}

export default Death;
